import React from 'react'
import PageButton from "../pageButton/pageButton"

export default function pageButtonsContainer({ page, numResults, changePage ,resPerPage = 16 }) {
     const pages = Math.ceil(numResults / resPerPage)

    if(page === 1 && pages > 1) return (
        <PageButton type="next" page={page} changePage={changePage}/>
    );     
    else if(page < pages) return (
        <div>
            <PageButton type="next" page={page} changePage={changePage}/>
            <PageButton type="prev" page={page} changePage={changePage}/>
        </div>
    );
    else if(page === pages && pages > 1) return (
        <PageButton type="prev" page={page} changePage={changePage}/>
    )
    else return (
        <span>Page 1</span>
    )
}
